import React from "react";

import { makeStyles, Paper, AppBar, Typography } from "@material-ui/core";

const useStyles = makeStyles({
  mainBg: {
    position: "fixed",
    height: "100vh",
    width: "100vw"
  }
});

export const PrimaryLayout = ({ children }) => {
  const classes = useStyles();
  return (
    <>
      <AppBar>
        <Typography variant="h3">Hamilton Hart</Typography>
      </AppBar>
      <Paper className={classes.mainBg}>{children}</Paper>
    </>
  );
};
